define({"topics" : [{"title":"Reporting functionality and permissions","shortdesc":"\n               <p class=\"shortdesc\"></p>\n            ","href":"reporting_functionality_and_permissions.html","attributes": {"data-id":"reporting_functionality_and_permissions",},"menu": {"hasChildren":false,},"tocID":"reporting_functionality_and_permissions-d66e3161","topics":[]},{"title":"Creating a report","shortdesc":"\n               <p class=\"shortdesc\">A report is a formatted view of a particular set of information extracted from the         Activity Journal, a set of database\n                  tables where policy activity data is logged.\n               </p>\n            ","href":"creating_a_report.html","attributes": {"data-id":"creating_a_report",},"menu": {"hasChildren":false,},"tocID":"creating_a_report-d66e3171","next":"creating_a_report-d66e3171",},{"title":"Running a report","shortdesc":"\n               <p class=\"shortdesc\"><span class=\"ph phindex\"></span></p>\n            ","href":"running_a_report.html","attributes": {"data-id":"running_a_report",},"menu": {"hasChildren":false,},"tocID":"running_a_report-d66e3268","topics":[]},{"title":"Viewing report output","shortdesc":"\n               <p class=\"shortdesc\">When viewing the report output, you can drill down for additional         information.</p>\n            ","href":"viewing_report_output.html","attributes": {"data-id":"viewing_report_output",},"menu": {"hasChildren":false,},"tocID":"viewing_report_output-d66e3279","next":"viewing_report_output-d66e3279",},{"title":"Saving reports","shortdesc":"\n               <p class=\"shortdesc\"></p>\n            ","href":"saving_reports.html","attributes": {"data-id":"saving_reports",},"menu": {"hasChildren":false,},"tocID":"saving_reports-d66e3302","topics":[]},{"title":"Sample reports","shortdesc":"\n               <p class=\"shortdesc\">This section presents examples of the available report formats, all representing a         simple set of event data returned\n                  by the same report query.\n               </p>\n            ","href":"sample_reports_0.html","attributes": {"data-id":"sample_reports_0",},"menu": {"hasChildren":false,},"tocID":"sample_reports_0-d66e3312","next":"sample_reports_0-d66e3312",},{"title":"Report anomalies","shortdesc":"\n               <p class=\"shortdesc\">Reports can show unexpected results at times, which may seem to reflect incorrect         behavior of policies, but in fact\n                  are a result of some of the ways Windows works internally,         or of inherent statistical issues.\n               </p>\n            ","href":"report_anomalies.html","attributes": {"data-id":"report_anomalies",},"menu": {"hasChildren":false,},"tocID":"report_anomalies-d66e3383","next":"report_anomalies-d66e3383",}]});